from dataclasses import dataclass
from typing import Tuple, List
import argparse
from pathlib import Path
import subprocess
import shlex
import json
import time

class FastRNG:
  def __init__(self, seed=1):
    self.state = seed if seed != 0 else 1

  def seed(self, seed):
    self.state = seed if seed != 0 else 1

  def _next(self):
    x = self.state
    x ^= (x << 13) & 0xFFFFFFFFFFFFFFFF
    x ^= (x >> 7)
    x ^= (x << 17) & 0xFFFFFFFFFFFFFFFF
    self.state = x & 0xFFFFFFFFFFFFFFFF
    return self.state

  def randint(self, a, b):
    r = self._next()
    return a + (r % (b - a + 1))

rng = FastRNG()

@dataclass
class TestParams:
  mem_cyc: Tuple[int, int]
  b_size: Tuple[int, int]
  wr_alloc: Tuple[int, int]
  l1_size: Tuple[int, int]
  l1_assoc: Tuple[int, int]
  l1_cyc: Tuple[int, int]
  l2_size: Tuple[int, int]
  l2_assoc: Tuple[int, int]
  l2_cyc: Tuple[int, int]
  n_ops: Tuple[int, int]
  ops: List[str]
  addresses: List[Tuple[int, int]]

def gen_test(test_num: int, params: TestParams):
  global rng
  rng.seed(test_num * 228_282_1337 + 42)
  mem_cyc = rng.randint(params.mem_cyc[0], params.mem_cyc[1])
  b_size = rng.randint(params.b_size[0], params.b_size[1])
  wr_alloc = rng.randint(params.wr_alloc[0], params.wr_alloc[1])
  l1_size = rng.randint(params.l1_size[0], params.l1_size[1])
  l1_assoc = rng.randint(params.l1_assoc[0], params.l1_assoc[1])
  l1_cyc = rng.randint(params.l1_cyc[0], params.l1_cyc[1])
  l2_size = rng.randint(params.l2_size[0], params.l2_size[1])
  l2_assoc = rng.randint(params.l2_assoc[0], params.l2_assoc[1])
  l2_cyc = rng.randint(params.l2_cyc[0], params.l2_cyc[1])

  n_ops = rng.randint(params.n_ops[0], params.n_ops[1])

  params_str = f"--mem-cyc {mem_cyc} --bsize {b_size} --wr-alloc {wr_alloc} --l1-size {l1_size} --l1-assoc {l1_assoc} --l1-cyc {l1_cyc} --l2-size {l2_size} --l2-assoc {l2_assoc} --l2-cyc {l2_cyc}"
  data = []
  for i in range(n_ops):
    op = params.ops[rng.randint(0, len(params.ops) - 1)]
    address_rng = params.addresses[rng.randint(0, len(params.addresses) - 1)]
    address = (rng.randint(address_rng[0], address_rng[1]) >> 2) << 2
    data.append(f"{op} 0x{address:08x}")
  data = "\n".join(data) + "\n"
  return params_str, data


